import "../styles/Intro.css";

const Intro = () => {
  return (
    <div className="Intro-wrapper">
      <div className="intro">
        <h4>Introduction</h4>
        <p>
          Established in 2011 with the help of Korea International Cooperation
          Agency (KOICA), this Centre was established in order to conduct
          various types of trainings, sponsored courses and conducting problem
          based research in the field of engineering and technology especially
          in the area of information and communication technology.This Centre
          was established in order to conduct various types of training,
          sponsored courses and conducting problem based research in the field
          of engineering and technology especially in the area of information
          and communication technology.
        </p>
      </div>
    </div>
  );
};

export default Intro;
